@CarlosTF50 "And at the moment that my camera happened to find you
There was just a trace of sorrow in your eyes."
 Fountain of Sorrow Jackson Browne.

@MrsSpedding @MrTs_NQTs Treat the children as you like to be treated. Respect them and their individuality. Be firm, but fair.
All that paperwork you sweat over, imagine it all in a bin bag 6 months down the line.
Have fun in the best job in the world.
